const storeList = {
    pageAtion: Array,
    pageEditid: Array,
    token: String,
    loginData: Object
}

const Reducer = (state = storeList, action) => {
    switch (action.type) {
        case 'login':
            return Object.assign({}, state, {
                loginData: state.loginData = action.data
            })

        default:
            return state
    }
}

export default Reducer
